import React, { useState, useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { Box, Container, Card, Grid, CardContent, Typography, Button, TextField } from "@mui/material";
import { getProfessionals } from '../../redux/slices/appointments/thunks';

const Professionals = () => {
    const professionals = useSelector((state) => state.professionals);
    const dispatch = useDispatch();

    useEffect(() => {
        dispatch(getProfessionals());
    }, []);

    const handleEdit = (customer) => {
        // Lógica para editar el cliente
    };

    return (
        <Container maxWidth="xl" style={{ height: '100vh', overflow: 'hidden' }}>
            <Box sx={{ maxHeight: '100%', overflowY: 'auto', height: '100%', width: '100%' }}>
                {professionals.professionals.length > 0 ? (
                    <Grid container spacing={2}>
                        {professionals.professionals.map((professional, index) => (
                            <Grid item xs={12} key={index}>
                                <Card variant="outlined" sx={{
                                    transition: 'transform 0.5s ease',
                                    '&:hover': {
                                        transform: 'scale(1.05)'
                                    },
                                    transform: 'scale(1)'
                                }}>
                                    <CardContent sx={{
                                        display: 'flex',
                                        flexDirection: 'row',
                                        gap: '20px',
                                        justifyContent: 'center',
                                        alignItems: 'center'
                                    }}>
                                        <Typography variant="h5" component="div" sx={{ fontSize: '1rem' }}>
                                            {professional.name}
                                        </Typography>
                                        <Typography color="text.secondary" component='div' sx={{ fontSize: '1rem' }}>
                                            DNI: {professional.dni}
                                        </Typography>
                                        {/* Agrega más detalles del profesional aquí según tu estructura de datos */}
                                        <Button onClick={() => handleEdit(professional)}>Editar</Button>
                                    </CardContent>
                                </Card>
                            </Grid>
                        ))}
                    </Grid>
                ) : (
                    <p>El array está vacío</p>
                )}
            </Box>
        </Container>
    );
};

export default Professionals;
